import React from 'react';
import { Routes, Route } from "react-router";
import { BrowserRouter, Link } from 'react-router-dom'
import Home from "./Components/Home";
import Cafe from "./Components/Cafe";
import Shop from "./Components/Shop";
import Macdonalds from "./Components/Macdonalds";
function App(props) {

    const linkstyle = {
        display: 'flex',
        flexDirection: 'column',
        gap: '10px'
    }
    return (


        <BrowserRouter>


            <Routes>
                <Route path="/home" element={<Home/>}/>
                <Route path="/macdonalds" element={<Macdonalds/>} />
                <Route path="/cafe" element={<Cafe />} />
                <Route path="/shop" element={<Shop/>} />
            </Routes>


            <div className="all-btn">
                <button><Link style={linkstyle} to="/home">Home</Link></button>
                <button><Link style={linkstyle} to="/cafe">Cafe</Link></button>
                <button><Link style={linkstyle} to="/shop">Shop</Link></button>
                <button><Link style={linkstyle} to="/macdonalds">Macdonalds</Link></button>
            </div>
        </BrowserRouter>


    );
}

export default App;
